  return (
    <div>
      <MainTitle classnameprop="page-title" label="Bitcoin Miner ⛏" />
      <Text classnameprop="main-text" label="Enter your name" />
      <Text classnameprop="bold-text" label="Bold text" />
      <Text classnameprop="accent-text" label="accent text here" />
      <Text classnameprop="small-text" label="accent text here" />
    </div>
  );
}

export default App;
